import React from 'react';
import './intro.css';
const Intro = () => {
  return (
    <section id="intro">
      <div className="introContent">
        <span className="hello"> Hello </span>
        <span className="introText"> I'm </span>
      </div>
      <img src="" alt="Profile" className="bg" />
    </section>
  )
}

export default Intro
